function aaa___examples___WindowLevel
%show 3 examples of the usage of WindowLevel

%show original image:
im=get_example_im;
figure(110),clf(110)
image(im)

example_1
example_2
example_3
end
function example_1
im=get_example_im;
im=uint8(mean(im,3));

figure(111),clf(111)
try
    imshow(im)
catch
    %imshow used to be part of the IPT
    h=image(im);
    set(h,'CDataMapping','scaled')
    colormap('gray'),daspect([1 1 1]),axis('off')
end
ax=gca;

enabled=true;
default_caxis_values=[50 250];
speed_multiplier=1;
legacy_colorbar=[];
enableTagTrigger=true;
WindowLevel(ax,enabled,default_caxis_values,speed_multiplier,legacy_colorbar,enableTagTrigger)
end
function example_2
im=get_example_im;
im=uint8(mean(im,3));

figure(112),clf(112)
try
    imshow(im)
catch
    %imshow used to be part of the IPT
    h=image(im);
    set(h,'CDataMapping','scaled')
    colormap('gray'),daspect([1 1 1]),axis('off')
end
ax=gca;

%Create a colorbar
c_b=cell(1,2);c_b{1,1}='vert';
c_b{1,2}=colorbar(c_b{1,1},'peer',ax);
%On R2012b (at least) and newer, passing the handle is not needed and it is
%ignored. The legacy behavior is probably only valid for ML6.5 and older.

enabled=true;
default_caxis_values=[50 250];
speed_multiplier=1;
legacy_colorbar=c_b;
enableTagTrigger=true;
WindowLevel(ax,enabled,default_caxis_values,speed_multiplier,legacy_colorbar,enableTagTrigger)
end
function example_3
im=get_example_im;
im=uint8(mean(im,3));

figure(113),clf(113)
try
    imshow(im)
catch
    %imshow used to be part of the IPT
    h=image(im);
    set(h,'CDataMapping','scaled')
    colormap('gray'),daspect([1 1 1]),axis('off')
end
ax=gca;

WindowLevel(ax)
end
function im=get_example_im
%created with this from a png:
% im=im(:);%linearize
% b1=rem(im,16);b2=((im-b1)/16);%split in hex parts
% im_as_char=char('a'+[b1;b2]);%encode as char
% im_as_cellstr=mat2cell(im_as_char',1,80*ones(numel(im_as_char)/80,1));
im=get_example_im___im_as_char;
middle=numel(im)/2;
b1=im(1:middle);
b2=im((middle+1):end);
b1=b1-'a';b2=b2-'a';
im=uint8(b1+b2*16);
im=reshape(im,400,400,3);
end
